import React, { Component } from 'react'

class SearchUsers extends Component {
  
  state = {
    search : "salam"
  }

  render() {
    return (
      <div>
        <form id='search-form'>
            <div className="mb-3">
                <label htmlFor="search" className="form-label">Search for users</label>
                <input value={this.state.search} type="text" className="form-control" id="search" autoComplete="off" />
            </div>
            <button type="submit" className="btn btn-primary w-100 mb-5">Search</button>
        </form>
      </div>
    )
  }
}

export default SearchUsers
